import { Route } from 'react-router-dom';
import Product from './Pages/Product';
import Welcome from './Pages/Welcome';
import MainHeader from './Component/MainHeader'
function App() {
  return (
    <>
      <MainHeader></MainHeader>
      <div>
        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/product">
          <Product />
        </Route>
      </div>
    </>

  );
}

export default App;



